import React from "react";
import "./Home.css";
import {
  AiFillFacebook,
  AiFillInstagram,
  AiFillTwitterSquare,
} from "react-icons/ai";
const Team = () => {
  return (
    <>
      <section className="team_section">
        <div className="container">
          <div className="row">
            <div className="col-lg-3 col-md-3 col-12">
              <div className="team_card shadow">
                <div className="team_img">
                  <img
                    src="https://wp.kodesolution.live/2021/business/colek/wp-content/uploads/2021/06/staff1.jpg"
                    alt="team_img"
                  />
                </div>
                <div className="team_content">
                  <h3>James Gordon</h3>
                  <p>Repair Man</p>
                </div>
                <div className="team_icons">
                  <AiFillFacebook  color="red"/>
                  <AiFillInstagram />
                  <AiFillTwitterSquare />
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Team;
